import React from "react";
import "./Forecast.css";

export default function Forecast(props){
    return(
<div className="forecast" id="iconsContainer">
    <h2 class= "weather"> {props.day} </h2> 
    <span class="image"> {props.icon} </span>

    <h5 id= "minTemp"> {props.minValue} </h5>
    <h5 id= "maxTemp"> {props.maxValue} </h5>
</div>
    )
}
